const CLIENT_ID = "b1d038f87be141efa43989f7368d8c4f"
const SPOTIFY_AUHTORIZE_ENDPOINT = "https://accounts.spotify.com/authroize"
const REDIRECT_URL_AFTER_LOGIN = "https://www.cricket.com.au/"
const SPACE_DELIMITER="%20"
const SCOPES = ["user-read-currently-playing"]
const SCOPES_URL_PARAM = SCOPES.join(SPACE_DELIMITER)

function App() {
  function handleLogin() {
    window.location = `${SPOTIFY_AUHTORIZE_ENDPOINT}?client_id=${CLIENT_ID}&redirect_uri=${REDIRECT_URL_AFTER_LOGIN}&scope=${SCOPES_URL_PARAM}&response_type=token&show_dialog=true`
  }
  return ( 
      <button onClick={handleLogin}>log in with spotify</button>
  );
}

export default App;
